import { Link } from "react-router-dom";
import classes from "./UkrainianNavigation.module.css";
function UkrainianFooter() {
  return (
    <footer>
        <div>Готель Панорама Маґура</div>
      <nav className={classes.navigation}>
        <Link className={classes.link} to="/ukrainian/aboutUs">
          Про нас
        </Link>
        <Link className={classes.link} to="/ukrainian/rooms">
          Номера та ціни
        </Link>
        <Link className={classes.link} to="">
          Галерея
        </Link>
        <Link className={classes.link} to="">
          Контакти
        </Link>
      </nav>
    </footer>
  );
}
export default UkrainianFooter;
